import React, { Component } from 'react';
import './Cardboard.css'

class Cardboard extends Component {
  render() {
    return (
      <div className="cardGrid">
        <div className="card">
          <h3>Our Strategic Plan for AY 2018</h3>
          <p>Last Updated - 06/10/2018</p>
        </div>
        <div className="card">
